        phone:"123-123-1234",
        address: "123 main st"
});

    return (
        <div>
            <h1>Profile Screen Demo</h1>

            <label>First Name</label>
            <input value={profile.firstName} />

            <label>Email</label>




        </div>


    )
}

export default ProfileScreenDemo;



